// SPDX-License-Identifier: MIT

pragma solidity >=0.8.0;
pragma experimental ABIEncoderV2;

import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract BookStore {

    using SafeMath for uint256;

    struct Book {
        string title;
        uint16 year;
    }

    mapping(address => uint) ownerBookCount;

    Book[] _books;

    function addBook(Book memory book) external returns(Book memory) {
        _books.push(book);
        ownerBookCount[msg.sender] = ownerBookCount[msg.sender].add(1);
        return book;
    }

    function getBooks() external view returns(Book[] memory) {
        return _books;
    }

    function getBooksCountrForOwner() external view returns(uint){
        return ownerBookCount[msg.sender];
    }
}

